import {
  REGISTER_SUCCESS,
  REGISTER_ERROR,
  GET_USER,
  LOGIN_SUCCESS,
  LOGIN_FAILURE,
  LOGOUT,
} from '../../types/index';

export default (state, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
